actionConfiguration.body:
() => {
  const vehicleData = appsmith.store['updateVehicleData'];
  if (!(vehicleData instanceof Object)) {
    return [];
  }
  var formattedCustomData = [];
  for (var customData of vehicleData.customData) {
    formattedCustomData.push({
      "name": customData.name,
      "value": customData.value
    });
  }
  return formattedCustomData;
}

